import React, { Component } from "react";

class History extends Component {
  render() {
    return (
      <div>
        <h1>History</h1>
        {this.props.pets.length > 0 &&
          this.props.pets.map((pet) => <p> pet.name</p>)}
      </div>
    );
  }
}

export default History;
